(25, 3, 6, 0, 'TEST'),
(26, 15, 6, 0, 'Paid Search:<br/>- Opgaver: Shopping afviste produkter. 0krs produkt-l√∏sning. Sammenl√¶gning af kampagnestruktur p√• kampagneniveau ifm udfasning af ETA\'er. Stresstest kampagne p√• lead gen - god start p√• den.<br/>Midfunnel test afsluttet (pr√¶mis mikrokonvertering - evaluerings kriterie salg)<br/>Road map: Q1 kampagnestrukt, ETA udfasning, Udrulning af Smartshopping og feed. Dashboard feedback. Lead gen test (stresstest)<br/>- Deadlines: Juni for kampagne struktur. resten er l√∏bende.<br/>Organic Search:<br/>- Opgaver: Magnus er blevet prim√¶r person p√• denne. Alt er live og processen k√∏rer godt med.<br/>- Deadlines: Update p√• resulater i midt/slut marts til feedback til bonnier - Klynge/magnus er p√• denne.<br/>Analytics:<br/>- Opgaver: Generelt fin optstart. \"SEO basker\"-analyse p√• HIS/ILL uden Paywall. Nye opgaver: Andele i digitalt salg imellem lande + performance af \"slideins i footer\". Har ikke kigget p√• CRO test endnu pga andet fokus i organisationen.<br/>- Deadlines: Ikke eksplicitte deadlines, udover at SE opgaver har h√∏jest prio.<br/>Paid Social:<br/>- Opgaver: Splittest af CPO m. lowest costs/cost cap - Spark AR skal nu testes af i strukturen i DK, som har til form√•l at h√∏jne engagements i DPA.<br/>- Deadlines: Produktion af AR i marts og test i april mdr. MK bygger & pr√¶senterer Paid Social road map for KYNETIC team (JS/MM) og derefter ogs√• for Bonnier Social team (vigtigt Pelle er med p√• denne m√∏d)<br/>Lead Gen- lead:<br/>- MM/JS er p√• en mulig opgave her.'),
