(36, 51, 7, 0, 'Generelt konverterer folk ikke s√• meget i markedet, som de plejer. <br/><br/>SEO: <br/>Opgaver: Content p√• sitet skal implementeres denne m√•ned fokus er FAQs og vi f√∏lger op. <br/>SEO team skal holdes i loopet p√• implementeringer af content, n√•r det bliver implementeret. <br/><br/>MA:<br/>Moon frav√¶rende/syg p√• dagen for sprint opstart. <br/><br/>Paid Search:<br/>Opgaver: Meget eftersp√∏rgsel i markedet, men meget lidt konvertering, som tilskrives at man kun kan k√∏be 1 palle pr. pers alts√• udbuddet i markedet.<br/>Fokus er at f√• ROAS skarp f√• √∏je.   <br/><br/>Paid Social:<br/>Satte gang i kampagner p√• br√¶ndet√•rne i uge 12/13. Sker for lidt p√• disse - fokus er p√• optimering af disse. Fokus er at f√∏lge performance og udvikle s√• ROAS passer. <br/>Betalingsgateway er lige blevet skiftet, som kan v√¶re √•rsag her. <br/><br/>CDP: <br/>Jeppe har bolden p√• denne. '),
(37, 4, 7, 0, 'SEO:<br/>- Lav crawl i Screaming Frog mhp. redirects (MN)<br/>- Strategi: Topic cluster visualiseringer, potentialeberegninger p√• clucsters, opdatering af contentplan, kunderejsemapping (MN)<br/><br/>Webmanagement: <br/>- Ops√¶tning af landingpages inkl. definition p√• hvordan en services side ser ud (MN+RV)<br/>- Overflytning af projekter (MN+RV)<br/><br/>Social:<br/>- Opf√∏lgning p√• nye kreativer (NN)<br/>- Tager kig p√• MA setup (NN)<br/><br/>Paid Search:<br/>- Dataanalyse, drift af setup og udbygning (RV)<br/>'),
