(2415, 'Optimering af budstrategier', '3.00', '4.00', 3, 'Brand kampagne anvender i dag m√•l-CPA og har YTD mistet 21,52% eksp. andel p√• brand s√∏gninger pga. denne budgivning. Vi anbefaler at anvende udvidet CPC mhp. \"altid\" at v√¶re synlig p√• brand s√∏gninger.<br />P√• resterende s√∏gekampagner anvendes ligeledes m√•l-CPA, hvilket med andre ord betyder vi optimerer efter at betale 480 kr. for alle typer af konverteringer, men konverteringerne er ikke det samme v√¶rd. Derfor b√∏r Eurodan overg√• til budstrategien \"Maksimer konverteringsv√¶rdi\".', 12, 0, 83, 1, 2, 2, 0, 0),
(2416, 'H√•ndtering og restrukturering af konv. tracking', '4.00', '5.00', 3, 'Lige nu t√¶ller \"Bestil fysisk Katalog 2020\" og \"M√∏de booking 2020\" begge som en konvertering. Mhp. at g√• til n√¶ste niveau b√∏r disse konverteringer differentieres mhp. at optimere mod konv. v√¶rdi (alts√• der hvor v√¶rdien er st√∏rst). Konverteringer som er sekund√¶re for Eurodan b√∏r angives som sekund√¶re fx konverteringspunktet \"Nyhedsbrev 2022\".', 12, 0, 83, 1, 2, 2, 0, 0),
(2417, 'Optimering af kontostruktur gennem implementering af KYNETIC Ads Framework', '7.00', '9.00', 3, 'Setup\'et best√•r af 1 brand kampagne, 3 generiske kampagner og en generisk DSA kampagne. F√¶lles for alle s√∏gekampagner er at de indeholder en lang r√¶kke annoncegrupper, hvilket ikke skaber s√¶rlig gode forhold for en algoritmisk budstrategi som fx m√•l-CPA. Den algoritmiske budgivning er fremtiden, men det underst√∏tter strukturen ikke i dag. I anbefales at konsolidere annoncegrupper.', 12, 0, 83, 1, 2, 2, 0, 0),
(2418, 'Optimering af annoncer og budskaber inkl. RSA udrulning', '5.00', '6.00', 3, 'Idet annoncegrupper konsolideres kan man blive bekymret for om kommunikationen bliver lige s√• relevant. Det g√∏r den med Responsive Search Ads (RSA), ved brug af elementer som fx keyword insertion som inds√¶tter den konkrete s√∏gestreng brugeren eftersp√∏rger. Ligeldes underst√∏tter RSA\'er mulihgeden for at kombinere overskrifter og beskrivelser p√• kryds og tv√¶rs som g√∏r at algoritmen har mere kommunikation at v√¶lge mellem og dermed matcher eftersp√∏rgsel med kommunikation baseret p√• hvad der har performet tidligere. I √∏vrigt er Expanded Text Ads et udg√•et annonceformat, som kontoen i prim√¶rt anvender i dag og endvidere har jeres f√• RSA\'er ikke en h√∏j nok annoncekvalitet.', 13, 0, 83, 1, 2, 2, 0, 0),
(2419, 'Automatisering af elementer i Google Ads setup', '3.00', '4.00', 3, 'I anbefales at arbejde med regler og scripts til at sikre oppetid og et minimum af fejl der kan p√•virke performance over l√¶ngere tid (herunder undg√• afviste ads) samt sikre at spendings, ratio mellem spend og konv. v√¶rdi mv. er on target.', 13, 0, 83, 1, 2, 2, 0, 0),
(2420, 'Optimering af annonceudvidelsessetup', '4.00', '5.00', 3, 'De enste udvidelser der anvendes p√• kontoen er hhv. appudvidelse, opkaldsudvidelse og adresseudvidelse. I anbefales at ops√¶tte undersidelinks og infoudvidelser mhp. st√∏rre blikfang p√• s√∏geresultatsiden.', 13, 0, 83, 1, 2, 2, 0, 0),
