(2422, 'Komplet teknisk SEO site audit ', '7.00', '9.00', 3, 'For at sikre dette tekniske SEO fundament foretager vi et komplet site audit hvor vi gennemg√•r sitet fra A-Z, og tjekker over 100 faktorer igennem som alle har en indflydelse p√• hvordan I ranker i Google. Dette vil blive leveret i form af en implementerbar rapport, hvori de nuv√¶rende problematikker og l√∏sningsforslag er beskrevet.', 12, 0, 83, 1, 2, 1, 0, 0),
