(5895, 'Format for paneldebat eller andre alternative formater', '2.00', '3.00', 3, '<ol><li>Panel Diskussion: Dette format er en samtale mellem flere eksperter om et bestemt emne. Du kunne invitere 3-4 eksperter inden for forskellige omr√•der af digital marketing. Kan b√•de v√¶re inhouse eller partnere. Disse eksperter kan dele deres unikke perspektiver og erfaringer. Kr√¶ver vi har nogle forberedte sp√∏rgsm√•l for at f√• diskussionen i gang, og derefter √•bne op for sp√∏rgsm√•l fra deltagerne. Her er der en moderator til at styre diskussionen og s√∏rge for, at den forbliver fokuseret og relevant.</li></ol><p><br></p><ol><li>Q&amp;A Sessions: Dette format er en √•ben diskussion, hvor deltagerne har mulighed for at stille sp√∏rgsm√•l. Du kan enten reservere en del af webinaret til en Q&amp;A session, eller du kan lave hele webinaret som en Q&amp;A session. Vi kan lade deltagerne indsende sp√∏rgsm√•l p√• forh√•nd, s√• vi kan forberede grundige svar, eller vi kan lade dem stille sp√∏rgsm√•l live under webinaret. Her skal vi nok selv formulere en masse sp√∏rgsm√•l selv, for at det ikke bliver kikset, hvis folk nu ikke er med p√• legen. Jeg ser det som en slags interview. Kunne ogs√• laves som lives. Det er dog lidt kikset, hvis der s√• ikke er nogen der skriver med sp√∏rgsm√•l</li></ol><p><br></p>', 24, 0, 58, 1, 1, 14, 0, 0),
